// TableComponent.jsx
import { useEffect, useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

const PAGE_SIZE = 10;

function TableComponent() {
  const [tournament, setTournament] = useState('');
  const [level,      setLevel]      = useState('');
  const [year,       setYear]       = useState('');
  const [results,    setResults]    = useState([]);
  const [page,       setPage]       = useState(1);
  const [hasMore,    setHasMore]    = useState(true);

  useEffect(() => {
    const params = new URLSearchParams({
      tournament: tournament + '%' || '%',
      level:      level + '%'      || '%',
      year:       year + '%'       || '%',
    });

    fetch(`http://127.0.0.1:5000/search/${page}?${params}`)
      .then(res  => res.json())
      .then(data => {
        setResults(data);
        // if we got fewer than PAGE_SIZE rows, there's no “next” page
        setHasMore(data.length === PAGE_SIZE);
      })
      .catch(console.error);
  }, [tournament, level, year, page]);

  const resetPage = () => setPage(1); 
  // whenever the filters change, reset back to page 1
  useEffect(resetPage, [tournament, level, year]);

  // "I'm Feeling Lucky" handler
  const handleLucky = () => {
    if (!results.length) return;
    const randomIndex = Math.floor(Math.random() * results.length);
    const r = results[randomIndex];
    const fileName = `${r.tournament}_${r.level}_${r.year}.pdf`;
    const pdfUrl  = `http://127.0.0.1:5000/static/rounds/${r.tournament}/${fileName}`;
    window.open(pdfUrl, '_blank');
  };

  return (
    <div className="container py-5">
      <h2 className="mb-4 text-center">Certamen Library</h2>

      {/* Filters */}
      <form className="row g-3 justify-content-center mb-4">
        <div className="col-sm-3">
          <input
            type="text"
            className="form-control"
            value={tournament}
            onChange={e => setTournament(e.target.value)}
            placeholder="Tournament"
          />
        </div>
        <div className="col-sm-2">
          <input
            type="text"
            className="form-control"
            value={level}
            onChange={e => setLevel(e.target.value)}
            placeholder="Level"
          />
        </div>
        <div className="col-sm-2">
          <input
            type="text"
            className="form-control"
            value={year}
            onChange={e => setYear(e.target.value)}
            placeholder="Year"
          />
        </div>
        {/* "I'm Feeling Lucky" Button */}
        <div className="text-center mb-3">
        <button
          className="btn btn-warning"
          onClick={handleLucky}
          disabled={!results.length}
        >
          I'm Feeling Lucky
        </button>
      </div>
      </form>

      {/* Results Table */}
      <div className="table-responsive mb-3">
        <table className="table table-striped table-hover align-middle">
          <thead className="table-dark">
            <tr>
              <th>Tournament</th>
              <th>Level</th>
              <th>Year</th>
            </tr>
          </thead>
            <tbody>
            {results.length > 0 ? (
                results.map((r, i) => {
                // build the URL to the PDF
                const fileName = `${r.tournament}_${r.level}_${r.year}.pdf`;
                const pdfUrl  = `http://127.0.0.1:5000/static/rounds/${r.tournament}/${fileName}`;

                return (
                    <tr
                    key={i}
                    style={{ cursor: 'pointer' }}
                    onClick={() => window.open(pdfUrl, '_blank')}
                    >
                    <td>{r.tournament}</td>
                    <td>{r.level}</td>
                    <td>{r.year}</td>
                    </tr>
                );
                })
            ) : (
                <tr>
                <td colSpan="3" className="text-center py-4">
                    No results found.
                </td>
                </tr>
            )}
            </tbody>
        </table>
      </div>

      {/* Pagination Controls */}
      <div className="d-flex justify-content-between">
        <button
          className="btn btn-outline-primary"
          onClick={() => setPage(p => Math.max(1, p - 1))}
          disabled={page === 1}
        >
          ← Previous
        </button>

        <span className="align-self-center">
          Page {page}
        </span>

        <button
          className="btn btn-outline-primary"
          onClick={() => setPage(p => p + 1)}
          disabled={!hasMore}
        >
          Next →
        </button>
      </div>
    </div>
  );
}

export default TableComponent;
